import React, { useState, useEffect } from 'react';
import { Routes, Route, Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

function App() {
  const [movies, setMovies] = useState([]);
  const [watchlist, setWatchlist] = useState([]);
  const [search, setSearch] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetchMovies();
  }, []);

  const fetchMovies = async () => {
    try {
      const response = await axios.get('http://localhost:8080/api/movies');
      setMovies(response.data);
    } catch (error) {
      console.error('Errore nel recupero dei film:', error);
    }
  };

  const handleSearchChange = (event) => {
    setSearch(event.target.value);
  };

  const handleAddToWatchlist = (movie) => {
    setWatchlist((prevList) => [...prevList, movie]);
  };

  const handleRemoveFromWatchlist = (movieId) => {
    setWatchlist((prevList) => prevList.filter((movie) => movie.id !== movieId));
  };

  const filteredMovies = movies.filter((movie) =>
    movie.title.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="container mt-4">
      <h1 className="text-center mb-4">Movie World</h1>

      <input
        type="text"
        className="form-control mb-4"
        placeholder="Cerca film..."
        value={search}
        onChange={handleSearchChange}
      />

      <div className="row">
        {filteredMovies.map((movie) => (
          <div key={movie.id} className="col-md-4 mb-4">
            <div className="card h-100">
              <img
                src={movie.imageUrl}
                className="card-img-top"
                alt={movie.title}
                style={{ height: '400px', objectFit: 'cover' }}
              />
              <div className="card-body d-flex flex-column">
                <h5 className="card-title">{movie.title}</h5>
                <p className="card-text">{movie.description}</p>

                <div className="mt-auto">
                  <Link to={`/movies/${movie.id}`} className="btn btn-primary btn-sm me-2">
                    Dettagli
                  </Link>

                  {watchlist.some((item) => item.id === movie.id) ? (
                    <button
                      className="btn btn-danger btn-sm"
                      onClick={() => handleRemoveFromWatchlist(movie.id)}
                    >
                      Rimuovi dalla Watchlist
                    </button>
                  ) : (
                    <button
                      className="btn btn-success btn-sm"
                      onClick={() => handleAddToWatchlist(movie)}
                    >
                      Aggiungi alla Watchlist
                    </button>
                  )}
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>

      <h2 className="mt-5">La tua Watchlist</h2>
      <div className="row">
        {watchlist.map((movie) => (
          <div key={movie.id} className="col-md-3 mb-3">
            <div className="card">
              <img
                src={movie.imageUrl}
                className="card-img-top"
                alt={movie.title}
                style={{ height: '200px', objectFit: 'cover' }}
              />
              <div className="card-body">
                <h6 className="card-title">{movie.title}</h6>
                <button
                  className="btn btn-danger btn-sm"
                  onClick={() => handleRemoveFromWatchlist(movie.id)}
                >
                  Rimuovi
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>

      <Routes>
        {/* Qui puoi aggiungere le tue rotte dinamiche per i dettagli film */}
      </Routes>
    </div>
  );
}

export default App;
